Entre las provincias con más contagios, encabeza Pichincha con 24.705, Guayas con 18.983casos, le siguen las provincias de Manabí 8.729, Santo Domingo de los Tsachilas con 4.560 y Azuay con 6.121.
Asimismo, el reporte señala que han sido 18.179 personas han sido atendidas en establecimientos del Ministerio de Salud Pública.

